base_output_dir = 'variablestxt\ACB 3WA Principal'

# Expresin regular para extraer la variable del nombre del archivo
# Ahora acepta cualquier tipo de variable
pattern = re.compile(r'_(|Estado_breaker|Razon_ultimo_disparo|ETU_defectuoso|Mantenimiento_ETU_requerido|Inspeccion_ETU_requerido|Limite_ETU_temperatura|Falla_corriente_L1|Falla_corriente_L2|Falla_corriente_L3|Falla_corriente_N|Mantenimiento_contactos_requerido|Sobrecarga_L1|Sobrecarga_L2|Sobrecarga_L3|Falla_tierra|Manteniento_breaker_requerido|Disparos_LT|Disparos_ST|Disparos_INST|Disparos_GF|Disparos_RP|Cantidad_ciclos_electricos|Cantidad_ciclos_mecanicos|Voltaje_L1_N|Voltaje_L2_N|Voltaje_L3_N|Corriente_L1|Corriente_L2|Corriente_L3|Energia|Energia_exportada|Temperatura_breaker|Temperatura_BSS)\.json$')

# Procesar cada archivo JSON
for json_file_path in json_files:
    # Obtener el nombre del archivo
    file_name = os.path.basename(json_file_path)
    
    # Extraer la variable del nombre del archivo usando regex
    match = pattern.search(file_name)
    
    if match:
        variable_name = match.group(1)  # Obtiene el nombre de la variable (e.g., Voltaje_L3_N o Corriente_L1)
        
        # Crear el nombre del directorio de salida basado en la variable
        output_dir = os.path.join(base_output_dir, variable_name)
        
        # Asegurarse de que el directorio de salida exista
        if not os.path.exists(output_dir):
            os.makedirs(output_dir)
        
        # Obtener el nombre del archivo sin la extensin
        output_txt_file = os.path.join(output_dir, f'{os.path.splitext(file_name)[0]}.txt')
        
        # Definir el encabezado segn la variable
        header = f"ACB 3WA Principal - {variable_name.replace('_', ' ')} type: UInt64\n"
        
        # Cargar el archivo JSON
        with open(json_file_path, 'r') as f:
            data = json.load(f)
        
        # Abrir el archivo de salida
        with open(output_txt_file, 'w') as f:
            # Escribir el encabezado del archivo .txt
            f.write(header)
            
            # Escribir cada lnea del JSON en formato TXT
            for entry in data:
                fecha = entry.get('_time')
                valor_variable = entry.get(variable_name)
                
                # Verificar si la fecha y el valor de la variable estn presentes
                if fecha and valor_variable is not None:
                    # Escribir la fecha y el valor en el archivo
                    f.write(f'{fecha}: {valor_variable/1000}\n')
        
        print(f'Archivo TXT guardado en {output_txt_file}')
    else:
        print(f'No se pudo extraer la variable del archivo: {file_name}')

print('Procesamiento completo.')
